import './App.css';
import { BrowserRouter as Router, Route } from 'react-router-dom';

import Nav from './Navagation';
import HomePage from './HomePage';
import Book from './Book';

function App() {
  return (
    <Router>
      <div className="App">
        <Route path="/" exact component={HomePage} />
        <Route path="/book" component={Book} />
      </div>


    </Router>

  );
}

export default App;
